INSERT INTO animal ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(1, 'Prika', 'Perro', 'Mestizo', 'Adulto', 'Alicante', 'Hembra', 'Mediano', 'Prika fue recogida junto a su hermano Parker, los dos son algo escapistas por lo que sospechábamos que se habían escapado, pero nadie los ha buscado. Es una perrita muy formal que se lleva bien con otros perros.', , NULL);
INSERT INTO animal ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(2, 'Kinder', 'Gato', 'Albisinio', 'Cachorro', 'Granada', 'Macho', 'Mediano', 'Kinder uno de los rescates de nuestras voluntarias, aun timida y asustadiza. Vivian en un tejado hasta que por fin fué rescatada junto a su hermanito Tiny    Kinder se encuentra en Granada pero puede viajar donde sea necesario para reunirse con su familia ideal.', , NULL);
INSERT INTO animal ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(3, 'Choco', 'Perro', 'Labrador', 'Adulto', 'Valencia', 'Macho', 'Grande', 'Se llama Choco, tiene 1 año y 2 meses. Es juguetón, cariñoso, muy bueno con gatos, niños y otros perros. Y está muy bien educado, no hace sus necesidades en casa nunca. Atiende a la llamada, y entiende las órdenes siéntate, quieto, ven aquí, coge la piedra/pelota.', , NULL);
INSERT INTO animal ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(5, 'Tayson', 'Perro', 'Bulldog', 'Cachorro', 'Granada', 'Macho', 'Pequeño', 'Se entrega castrado Comportamiento con perros: apto Comportamiento con niños: desconocido Comportamiento con gatos: desconocido Carácter: bueno, sociable, activo. Tayson es muy fiel y tiene un enorme apego por su cuidadora. Historia: Estaba abandonado en muy mal estado. Está acogido en Granada', , NULL);
INSERT INTO animal ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(6, 'Floki', 'Gato', 'Siames', 'Adulto', 'Barcelona', 'Macho', 'Mediano', 'Floki, más buenazo no puede ser!!! De verdad, que es un gato todo corazón, un amor cariñosón y mimosón y un nene 10 que no entiende porque su familia lo abandonó… Y si vienes a conocerlo y lo llevas contigo, te lo agradecerá del por vida.', , NULL);
INSERT INTO animal ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(7, 'Sara', 'Perro', 'Dachshund', 'Cachorro', 'Galicia', 'Hembra', 'Mediano', 'Carácter: Es muy activa, alegre, valiente, quiere jugar a todas horas, es incansable. Historia: Esta perrita fue encontrada en la calle. Como todo cachorro, es importante recordar que necesitan de atención, tiempo y educación para hacer de ellos un perro adulto y estable. Se entrega con compromiso de castración.', , NULL);
INSERT INTO 'animal' ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(8, 'Doro', 'Gato', 'Común Europeo', 'Cachorro', 'Madrid', 'Macho', 'Pequeño', 'RIVANIMAL Asociación Protectora de Animales sin ánimo de lucro, está cuidando a estos hermanitos, que rescatamos de una zona muy peligrosa. Ahí hemos encontrado ya a varios gatos a los que han disparado con balines. Llegaron pequeños y con hongos, pero ahora ya están listos para irse a una casa definitiva.', , NULL);
INSERT INTO animal ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(9, 'Sussy', 'Perro', 'Alano', 'Senior', 'Córdoba', 'Hembra', 'Pequeño', 'Sussy es tan dulce, ella sólo quere mimos y cariño.', , NULL);
INSERT INTO animal ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(10, 'Maki', 'Gato', 'American wirehair', 'Cachorro', 'Madrid', 'Macho', 'Pequeño', 'Fecha nacimiento: Abril 2018 Sexo : Macho Maki parece un muñero, es un gato bueno y tranquilo Ha dado positivo a leucemia pero está muy bien y hace una vida completamente normal. Se entregará en adopción con el protocolo completo.', , NULL);
INSERT INTO animal ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(11, 'Dana', 'Perro', 'Corgi galés', 'Adulto', 'Málaga', 'Hembra', 'Mediano', 'Fecha de nacimiento aproximada: 01/07/2015 Dana vino a Canópolis porque su familia ya no podía seguir haciéndose cargo de ella. Es muy sociable con todas las especies y con l@s niñ@s se lleva muy bien.', , NULL);
INSERT INTO animal ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(12, 'Fito', 'Gato', 'Mestizo', 'Adulto', 'Granada', 'Macho', 'Grande', 'Hola, me llamo FITO, al fin me han puesto un nombre decente porque desde que llegué a este sitio me han llamado de todo…Estoy buscando con urgencia una casa de acogida sin gatos. ¿Me acoges y yo te ronroneo?', , NULL);
INSERT INTO animal ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(13, 'Ankor', 'Perro', 'Husky Siberiano', 'Adulto', 'Alicante', 'Macho', 'Grande', 'Ankor fue encontrado en la calle. Después de mucho tiempo buscando a su familia, creemos que ya es hora de buscar una buena adopción para él, se la merece. Llegó muy delgado, todo indicaba que no había estado bien cuidado.', , NULL);
INSERT INTO animal ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(14, 'Dama', 'Gato', 'Scottish Fold', 'Adulto', 'Asturias', 'Hembra', 'Grande', 'Carácter: Tímida durante solo un día, después en cuanto coge confianza es un saco de mimos y súper sociable porque ha vivido toda la vida con más gatos. Aún con mucha vitalidad, le encanta jugar.', , NULL);
INSERT INTO 'animal' ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(15, 'Fara', 'Perro', 'Bichón Maltés', 'Cachorro', 'Sevilla', 'Hembra', 'Pequeño', 'Encontrada en la carretera una tarde de lluvia, estuvieron a punto de atropellarla varias veces pero paramos y nos la llevamos al refugio, no tenia chip, ni collar ni nada indentificativo y tampoco nadie la ha reclamado.', , NULL);
INSERT INTO 'animal' ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(16, 'Zuri', 'Gato', 'Mestizo', 'Adulto', 'Madrid', 'Macho', 'Grande', 'Fecha nacimiento: Julio 2021 Sexo : Macho Zuri ha vivido solo en un patio, sin la compañía ni de personas ni de otros animales. Es independiente y tímido, pero no asustadizo. Se entregará en adopción con el protocolo veterinario completo.', , NULL);
INSERT INTO 'animal' ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(17, 'Tango', 'Perro', 'Pitbull', 'Cachorro', 'Castellón', 'Macho', 'Mediano', 'Tango es un Cruce de Pitbull que busca una familia adoptiva. Él fue encontrado por una familia que lo tuvo en casa pero al no poder prestarle atención veterinaria contactó con Huellas callejeras. ', , NULL);
INSERT INTO 'animal' ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(18, 'Roxas', 'Gato', 'Mestizo', 'Cachorro', 'Ceuta', 'Macho', 'Pequeño', 'Su mamá fue abandonada en un pueblo de Cuenca, cuando fue a dar a luz, se refugio en una casa para tener a sus bebes a salvo y allí nació Roxas, es un gatito cariñoso.', , NULL);
INSERT INTO 'animal' ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(19, 'Blackie', 'Perro', 'Labrador', 'Cachorro', 'Malaga', 'Macho', 'Pequeño', 'Junto con el otro labrador Rex, pertenecian a una familia de rumanos que dejaban el país. Contactaron con nosotros por si nos interesaba quedarnos con ellos.', , NULL);
INSERT INTO 'animal' ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(20, 'Cirene', 'Gato', 'American shorthair', 'Cachorro', 'Madrid', 'Hembra', 'Pequeño', 'Vinimos al mundo a causa de la irresponsabilidad humana, monstruos que además de no castrar a nuestra madre la abandonaron a punto de parir en mitad del campo.', , NULL);
INSERT INTO 'animal' ('idAnimal', 'nombre', 'especie', 'raza', 'edad', 'localidad', 'sexo', 'tamano', 'descripcion', 'imagen', 'idUsuario') VALUES
(21, 'Tiger', 'Gato', 'Tigre de Bengala', 'Adulto', 'Murcia', 'Macho', 'Grande', 'A Tiger le gusta mucho jugar a perseguir al humano, no come mucho pero está sano y fuerte, su ronroneo de gatito puede dormir a cualquiera de un susto.', , NULL);

